CREATE DATABASE fateca;

use fateca;

/* tipos de items*/
CREATE TABLE IF NOT EXISTS types (
    id INT(11) NOT NULL AUTO_INCREMENT PRIMARY KEY,
    type VARCHAR(255) NOT NULL UNIQUE,
    created DATETIME,
    modified DATETIME    
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 AUTO_INCREMENT=8 ;

/* trocar para itens depois */
CREATE TABLE IF NOT EXISTS books (
    id INT(11) NOT NULL AUTO_INCREMENT PRIMARY KEY,
    title VARCHAR(255) NOT NULL,
    type_id INT(11) NOT NULL,
    status INT(11) NOT NULL,
    created DATETIME,
    modified DATETIME
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 AUTO_INCREMENT=10000 ;

CREATE TABLE IF NOT EXISTS isbns (
    id INT(11) NOT NULL AUTO_INCREMENT PRIMARY KEY,
    book_id INT(11) NOT NULL,
    isbn10 VARCHAR(255) DEFAULT NULL,
    isbn13 VARCHAR(255) DEFAULT NULL,
    created DATETIME,
    modified DATETIME
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 AUTO_INCREMENT=9000 ;

CREATE TABLE IF NOT EXISTS people (
    id INT(11) NOT NULL AUTO_INCREMENT PRIMARY KEY,
    ra VARCHAR(255) DEFAULT NULL,
    name VARCHAR(255) NOT NULL,
    group_id INT(11) NOT NULL,
    username VARCHAR(255) UNIQUE,
    password CHAR(40),
    created DATETIME,
    modified DATETIME
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 AUTO_INCREMENT=1001 ;

CREATE TABLE IF NOT EXISTS phones (
    id INT(11) NOT NULL AUTO_INCREMENT PRIMARY KEY,
    person_id INT(11) NOT NULL,
    phone VARCHAR(255) NOT NULL,
    created DATETIME,
    modified DATETIME 
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 AUTO_INCREMENT=1601 ;


CREATE TABLE IF NOT EXISTS emails (
    id INT(11) NOT NULL AUTO_INCREMENT PRIMARY KEY,
    person_id INT(11) NOT NULL,
    email VARCHAR(255) NOT NULL,
    created DATETIME,
    modified DATETIME 
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 AUTO_INCREMENT=1001 ;


CREATE TABLE IF NOT EXISTS loans (
    id INT(11) NOT NULL AUTO_INCREMENT PRIMARY KEY,
    person_id INT(11) NOT NULL,
    book_id INT(11) NOT NULL,
    fine NUMERIC(10, 2) DEFAULT  NULL,
    payed NUMERIC(10, 2) DEFAULT 0.0,
    returned DATETIME DEFAULT NULL,
    created DATETIME,
    modified DATETIME
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 ;

CREATE TABLE IF NOT EXISTS system_rules (
    id INT(11) NOT NULL AUTO_INCREMENT PRIMARY KEY,
    name VARCHAR(255) NOT NULL UNIQUE,
    value VARCHAR(255) DEFAULT NULL,
    created DATETIME,
    modified DATETIME
) ENGINE=InnoDB  DEFAULT CHARSET=utf8;

CREATE TABLE IF NOT EXISTS groups (
    id INT(11) NOT NULL AUTO_INCREMENT PRIMARY KEY,
    name VARCHAR(255) NOT NULL UNIQUE,
    created DATETIME,
    modified DATETIME
) ENGINE=InnoDB  DEFAULT CHARSET=utf8 AUTO_INCREMENT=2 ;











